import React from "react";
import { useNavigate } from "react-router-dom";

const SADashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="flex min-h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-64 bg-gray-800 text-white p-6">
        <h2 className="text-2xl font-bold mb-8">System Admin</h2>
        <ul>
          <li
            className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer"
            onClick={() => navigate("/phases")}
          >
            Phase Management
          </li>
          <li
            className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer"
            onClick={() => navigate("contract-types")}
          >
            Contract Type Management
          </li>
          <li
            className="mb-4 hover:bg-gray-700 p-2 rounded cursor-pointer"
            onClick={() => navigate("/admin/audit-trail")}
          >
            Audit Trail
          </li>
        </ul>
      </aside>

      {/* Main Content */}
      <main className="flex-1 p-8">
        <h1 className="text-3xl font-bold text-gray-800 mb-4">Welcome to Admin Panel</h1>
        <p className="text-gray-700 mb-2">Use the sidebar to manage Master Data:</p>
        <ul className="list-disc list-inside text-gray-600">
          <li>Manage project phases and their statuses</li>
          <li>Configure contract types used across projects</li>
          <li>Track changes with audit logs</li>
        </ul>
      </main>
    </div>
  );
};

export default SADashboard;
